import React from 'react';  
import axios from 'axios'; 

class listaFormas extends React.Component {  
    constructor() {  
        super();  
        this.state = {  
            FormasData: []  
        }  
        
    }  
  
    componentDidMount() {  
        axios.get("http://localhost:49548/api/Formas").then(response => {  
            //console.log(response.data);  
            this.setState({  
                FormasData: response.data  
            });  
        });  
    }  
  
    render() {  
  
        return (  
            <section>  
                <h1>Lista de Formas</h1>  
                <div>  
                    <table>  
                        <thead><tr><th>Guid</th><th>Nome</th></tr></thead>  
                        <tbody>  
                            {  
                                this.state.FormasData.map(p => {  
                                    return <tr><td> {p.FormasId}</td><td> {p.NomeForma}</td></tr>;  
                                })  
                            }  
                        </tbody>  
                    </table>  
                </div>  
  
  
            </section>  
        )  
    }  
}  
  
export default listaFormas;
